import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Container from 'react-bootstrap/esm/Container';
import salt from './Himalayan_Salt.png';
import Collapse from 'react-bootstrap/Collapse';

function TypeService ({ name, price, category, color, stock, id}) {

    const [open, setOpen] = useState(false)
    return (
        <Card className='m-2' style={{ width: '18rem' }}>
            <Card.Img variant="top" src={salt}/>
            <Card.Body>
                <Card.Title>{name}</Card.Title>
                <Card.Text>
                    <Row>
                        <Col>{color}</Col>
                    </Row>
                    <Row>
                        <Col>{price}</Col>
                    </Row>
                    <Row>
                        <Col>{category}</Col>
                    </Row>
                </Card.Text>
                <Container className='text-center'>
                <Button 
                    variant="primary" 
                    style={{ width: '150px'}}
                    onClick={() => setOpen(!open)}
                    aria-controls="example-collapse-text9"
                    aria-expanded={open9}
                >
                    See more details
                </Button>
                <div style={{ minHeight: '150px', marginTop:'60px'}}>
                    <Collapse in={open} dimension="width">
                        <div id="example-collapse-text9">
                            <Card body style={{ width: '300px'}}>
                                Anim pariatur cliche reprehenderit, enim eiusmod high life
                                accusamus terry richardson ad squid. Nihil anim keffiyeh
                                helvetica, craft beer labore wes anderson cred nesciunt sapiente
                                ea proident.
                            </Card>
                        </div>
                    </Collapse>
                </div>
                </Container>
            </Card.Body>
        </Card>
    );
}

export default TypeService;
